function readDigits() {
var k = 0;
var s = false;
var fpos = pos;
while (true) {
var c = get(pos);
if (StringTools.isEof(c))
break;
if (c == "-".code) {
if (pos != fpos)
break;
s = true;
pos++;
continue;
}
if (c < "0".code || c > "9".code)
break;
k = k * 10 + (c - "0".code);
pos++;
}
if (s)
k *= -1;
return k;
}

function readFloat() {
var p1 = pos;
while (true) {
var c = get(pos);
if (StringTools.isEof(c))
break;
// + - . , 0-9
if ((c >= 43 && c < 58) || c == "e".code || c == "E".code)
pos++;
else
break;
}
return Std.parseFloat(buf.fastSubstr(p1, pos - p1));
}

function unserializeObject(o:{}) {
while (true) {
if (pos >= length)
throw "Invalid object";
