static function leq<T>(f:T->T->Bool, l1:Array<T>, l2:Array<T>) {
var it = l2.iterator();
for (e1 in l1) {
if (!it.hasNext())
return false;
var e2 = it.next();
if (!f(e1, e2))
return false;
}
if (it.hasNext())
return false;
return true;
}

/**
