if (c1.doc != c2.doc)
return false;
if ((c1.args == null) != (c2.args == null))
return false;
if (c1.args != null && !leq(function(a, b) {
return a.name == b.name && a.opt == b.opt && typeEq(a.t, b.t);
}, c1.args, c2.args))
return false;
return true;
}
